import React from "react";
import "./App.css";

import MyHeader from "./MyHeader";
import MyFooter from "./MyFooter";

function App() {
  let name = "hyejin";

  return (
    <div className="App">
      <MyHeader></MyHeader>
      <header className="App-header">
        <h2>안녕 리액트 {name}</h2>
      </header>
    </div>
  );
}

export default App;
